import React from 'react';
import Icon from '@ant-design/icons';

import svgIcons from './svg';

export const SearchIcon = (props?: any) => <Icon component={svgIcons.SearchSvg} {...props} />;
export const MediaMixerIcon = (props?: any) => (
    <Icon component={svgIcons.MediaMixerSvg} {...props} />
);
export const CloseIcon = (props?: any) => <Icon component={svgIcons.CloseSvg} {...props} />;
export const ReloadIcon = (props?: any) => <Icon component={svgIcons.ReloadSvg} {...props} />;
export const UneEyeIcon = (props?: any) => <Icon component={svgIcons.UnEyeSvg} {...props} />;
export const PhoneIcon = (props?: any) => <Icon component={svgIcons.PhoneSvg} {...props} />;
export const UnPhoneIcon = (props?: any) => <Icon component={svgIcons.UnPhoneSvg} {...props} />;
export const BookmarkIcon = (props?: any) => <Icon component={svgIcons.BookmarkSvg} {...props} />;
export const TagIcon = (props?: any) => <Icon component={svgIcons.TagSvg} {...props} />;
export const ClockIcon = (props?: any) => <Icon component={svgIcons.ClockSvg} {...props} />;
export const EmultipleIcon = (props?: any) => <Icon component={svgIcons.EmultipleSvg} {...props} />;
export const CopyIcon = (props?: any) => <Icon component={svgIcons.CopySvg} {...props} />;
export const FacebookIcon = (props?: any) => <Icon component={svgIcons.FacebookSvg} {...props} />;
export const MessageIcon = (props?: any) => <Icon component={svgIcons.MessageSvg} {...props} />;
export const PasteIcon = (props?: any) => <Icon component={svgIcons.PasteSvg} {...props} />;
export const PhotoIcon = (props?: any) => <Icon component={svgIcons.PhotoSvg} {...props} />;
export const ChatIcon = (props?: any) => <Icon component={svgIcons.ChatSvg} {...props} />;
export const SendIcon = (props?: any) => <Icon component={svgIcons.SendSvg} {...props} />;
export const TrashIcon = (props?: any) => <Icon component={svgIcons.TrashSvg} {...props} />;
export const BoxIcon = (props?: any) => <Icon component={svgIcons.BoxSvg} {...props} />;
export const ChatGroupIcon = (props?: any) => <Icon component={svgIcons.ChatGroupSvg} {...props} />;
export const CameraIcon = (props?: any) => <Icon component={svgIcons.CameraSvg} {...props} />;
export const CartIcon = (props?: any) => <Icon component={svgIcons.CartSvg} {...props} />;
export const ChartIcon = (props?: any) => <Icon component={svgIcons.ChartSvg} {...props} />;
export const OtherIcon = (props?: any) => <Icon component={svgIcons.OtherSvg} {...props} />;
export const DoubleRightIcon = (props?: any) => (
    <Icon component={svgIcons.DoubleRightSvg} {...props} />
);
export const DoubleLeftIcon = (props?: any) => (
    <Icon component={svgIcons.DoubleLeftSvg} {...props} />
);
export const DownIcon = (props?: any) => <Icon component={svgIcons.DownSvg} {...props} />;
export const RightIcon = (props?: any) => <Icon component={svgIcons.RightSvg} {...props} />;
export const DetailIcon = (props?: any) => <Icon component={svgIcons.DetailSvg} {...props} />;
export const PlusDashedCircle = (props?: any) => (
    <Icon component={svgIcons.PlusDashedCircle} {...props} />
);
export const OrderDraftIcon = (props?: any) => <Icon component={svgIcons.DraftOrder} {...props} />;
export const WeatherSunny = (props?: any) => <Icon component={svgIcons.WeatherSunny} {...props} />;
export const EmptyProduct = (props?: any) => <Icon component={svgIcons.EmptyProduct} {...props} />;
export const SearchDocumentIcon = (props?: any) => (
    <Icon component={svgIcons.SearchDocument} {...props} />
);

export const PrimaryChevronRightIcon = (props?: any) => (
    <Icon component={svgIcons.PrimaryChevronRightSvg} {...props} />
);

export const PlusThickerIcon = (props?: any) => (
    <Icon component={svgIcons.PlusThickerSvg} {...props} />
);

export const FacebookOutlinedIcon = (props?: any) => (
    <Icon component={svgIcons.FacebookOutlinedSvg} {...props} />
);
